# 创建一个ts列表来保存所有的.ts链接
ts_lst = []
for line in content.split("\n"):  # 可以看到每一行以换行结束，我们可以利用字符串的切片操作.split(sep=),指定切分符为\n，那么就会返回一个去掉换行的列表
    if not line.startswith("#"):  # 接下来去掉我们不想要的m3u8的关键字tag标识
        print(line)  # 最后将符合要求的行打印出来先看一眼对不对
        # 将获得到的所有ts链接保存到ts列表当中
        ts_lst.append(line)


# 我们要改写的就是这里，也就是循环遍历ts并下载ts
# 异步请求到每个ts切片数据
async def get_ts(url):
    # 会报错的，因为这里我们不能像之前那样加上verify=False那么简单
    # conn = aiohttp.TCPConnector(verify_ssl=False)  # 防止ssl报错
    # async with aiohttp.ClientSession(connector=aiohttp.TCPConnector(limit=64, verify_ssl=False)) as session:

    # async with aiohttp.ClientSession() as sess:
    async with aiohttp.ClientSession(connector=aiohttp.TCPConnector(verify_ssl=False)) as sess:
        async with await sess.get(url=url, headers=headers) as response:
                ts_data = await response.read()  # 获取二进制形式的响应 注意，requests模块中用的是.content模块，而aiohttp用的是.read()方法
                print(ts_data, url)
                return [ts_data, url]  # 返回数据


# 创建回调函数用于保存数据
def t_callback(t):
    r_list = t.result()
    ts_data = r_list[0]  # 接收特殊函数的返回的数据
    url = r_list[1]
    ts_name = url.split('/')[-1]
    ts_path = dirname + '/' + ts_name
    with open(ts_path, 'wb') as fp:
        fp.write(ts_data)
    print(ts_name, '下载保存成功!')


tasks = []
for url in ts_lst:
    # 创建协程对象
    c = get_ts(url)
    #    创建任务对象
    task = asyncio.ensure_future(c)

    # 添加用于下载ts文件的回调函数
    task.add_done_callback(t_callback)
    tasks.append(task)
    #     创建事件循环对象
loop = asyncio.get_event_loop()
loop.run_until_complete(asyncio.wait(tasks))

